import React, {useState} from "react";
import Modal from "react-modal";
import bp3 from '../images/bp3.jpeg';

const Bp3 = () => {
  const [modal_IsOpen, set_IsOpen] = useState(false);

  const openModal = () => {
    set_IsOpen(true);
  }

  const closeModal = () => {
    set_IsOpen(false);
  }

  return (
    <>
      <img onClick={openModal} className="square" src={bp3} />
      <Modal 
        isOpen={modal_IsOpen}
        onRequestClose={closeModal}
        className="modal"
        ariaHideApp={false}
        closeTimeoutMS={200}
        onAfterOpen
        >
        <div className="container-img">
          <img className="img" src={bp3} />
          <button onClick={closeModal} className="btn">Back</button>
        </div>
        </Modal>
    </>
  )
}

export {Bp3 as default};
